import React, { useState } from 'react'
import { TextField, Button } from '@mui/material'

const Blog = ({ addBlog }) => {
  const [blogTitle, setBlogTitle] = useState('')
  const [blogAuthor, setBlogAuthor] = useState('')
  const [blogUrl, setBlogUrl] = useState('')

  return(
    <>
      <h3>+ New blog</h3>
      <form onSubmit={(event) => addBlog({ e: event, blogTitle, blogAuthor, blogUrl })}>
        <TextField size="sm" id="title" value={blogTitle} placeholder="title" onChange={({ target }) => setBlogTitle(target.value)}/><br/>
        <TextField size="sm" id="author" value={blogAuthor} placeholder="author" onChange={({ target }) => setBlogAuthor(target.value)}/><br/>
        <TextField size="sm" id="url" value={blogUrl} placeholder="url" onChange={({ target }) => setBlogUrl(target.value)}/>
        <Button id="submitBlogButton" type="submit">send</Button>
      </form>
    </>
  )
}

export default Blog
